Defendant Jordan G Giesler in court with attorney Anne A Devitt.  Thomas L Potter appeared for the State of Wisconsin.

After minor corrections/amendments to original complaint made on the record, AS TO COUNTS 1 and 2, Defendant changes plea to GUILTY. Defendant examined as to his plea, advised of his Constitutional rights and the maximum penalty. Court found that defendant freely, voluntarily and intelligently waived his rights. Plea questionnaire received and filed. Parties stipulate to the complaint as a factual basis to sustain defendant's plea. Court found defendant guilty as charged in the information and ordered a Judgment of Conviction be entered on the record. Defendant is advised he is a convicted felon and may not possess any firearms. Defendant is advised he is unable to vote in any election until civil rights are restored. Defendant further advised that if he is not a US citizen deportation is possible.  

Sentencing proceeds.  Statements made by the state, defense counsel and defendant. 

AS TO COUNT 1
Defendant sentenced to serve 12 MONTHS at the HOUSE OF CORRECTION. Credit for 3 days time served. COURT STAYS sentence and placed defendant on PROBATION for a period of 3 years.  MAY BE SERVED IN DANE COUNTY (MADISON) IF DEEMED APPROPRIATE.

AS TO COUNT 2
Defendant sentenced to serve 9 MONTHS at the HOUSE OF CORRECTION, CONCURRENT to COUNT 1. Credit for 3 days time served, CONCURRENT to COUNT 1. COURT STAYS sentence and placed defendant on PROBATION for a period of 1 YEAR, CONCURRENT to COUNT 1.  MAY BE SERVED IN DANE COUNTY (MADISON) IF DEEMED APPROPRIATE.

Court orders defendant to serve 30 DAYS CONDITION TIME IN THE HOUSE OF CORRECTION, with HUBER RELEASE PRIVILEGES for WORK.  Defendant to report to the House of Corrections on 06-30-2014 by 5pm.  Sentencing Referral Form SIGNED AND FILED.
.
CONDITIONS OF PROBATION: 
-AODA assessment and cooperate with any programs deemed necessary by the probation department;
-maintain sobriety, no alcohol, no drugs;
-no possession/consumption/selling/distribution of illegal drugs/alcohol;
-random urine screens, if deemed appropriate;
-obtain/maintain fulltime employment/education/vocation;
-complete 80 HOURS of community service;
-pay fine in the amount of $500.00; failure to pay shall result in a civil judgment being entered;
-no contact with victim, Rebecca B.;
-pay restitution in the amount of $200.00 to Rebecca B; failure to pay shall result in a civil judgment being entered;
-pay all court costs, fees, and surcharges; failure to pay shall result in a civil judgment being entered;
-provide DNA sample;
-pay MANDATORY DNA surcharges;  failure to pay shall result in a civil judgment being entered;
-pay all applicable fees of supervision; failure to pay shall result in a civil judgment being entered.
-
-  Payment Plan for all monetary obligations to be established by Department of Corrections, Probation and Parole.  All unpaid balances at the end of the probationary period will convert to a civil judgment.
-  Firearm/Voting/Civil Judgment Warnings given.
-  No Cash Bail Posted in this matter.  
-  Expungement to be granted after successful completion of probation period and repayment of all monetary obligations, including restitution.

Appeal rights given. Notice of Right to Seek Postconviction Relief received and filed. Copy given to defendant.
